var Camera = (function () {
    function Camera(gl, canvas) {
        this.gl = gl;
        this.canvas = canvas;
        this.pMatrix = mat4.create();
        mat4.identity(this.pMatrix);
        this.pos = vec3.create();
    }
    Camera.prototype.setPosition = function (x, y, z) {
        vec3.set(this.pos, x, y, z);
    };
    Camera.prototype.Setup = function () {
        mat4.identity(this.pMatrix);
        this.gl.viewport(0, 0, this.canvas.width, this.canvas.height);
        mat4.perspective(this.pMatrix, 0.87, this.canvas.width / this.canvas.height, 0.1, 100.0);
        mat4.rotateX(this.pMatrix, this.pMatrix, 0.6);
        mat4.translate(this.pMatrix, this.pMatrix, this.pos);
    };
    return Camera;
})();
